import React from "react";
import "./App.css";
import Home from "./pages/Home";
import MenuPage from "./pages/MenuPage";
import Locations from "./pages/Locations";
import Subscriptions from "./pages/Subcriptions";
import { Routes } from "react-router-dom";
import { BrowserRouter as Router, Route, Link} from 'react-router-dom';
import MenuItemDetails from './pages/MenuItemDetails';
import menuData from './db.json'
import { useState, useEffect } from "react";


const Favorites = () => (
  <div>
    <h2>Favorites</h2>
    {/* Display user's favorite items here */}
  </div>
);

const App = () => {

  <Router>
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="Locations">Locations</Link></li>
        <li><Link to="MenuPage">Menu</Link></li>
        <li><Link to="Subscriptions">Subscriptions</Link></li>
        <li><Link to="Favorites">Favorites</Link></li>
      </ul>
    </nav>

    <Routes>
      <Route path="/" exact component={Home} />
      <Route path="Locations" element={<Locations />} />
      <Route path="MenuPage" element={<MenuPage />} />
        <Route path="menu/:itemId" element={<MenuItemDetails/>} />
        <Route path="/favorites:userId" component={Favorites} /> 
      <Route path="Subscriptions" element={<Subscriptions/>} />
    </Routes>

  </Router>
};

export default App;
